import React from "react";
import "../public/Styles.css";
import DashboardUser from "./DashboardUser";
import DashboardSup from "./DashboardSup";
import DashboardAdmin from "./DashboardAdmin";

function Dashboard() {
  const user_id = parseInt(localStorage.getItem('user_id')); // Parse the user_id

  console.log(user_id); // Debugging: Check the user_id

  if (user_id === 15) {
    console.log('Rendering DashboardSuperUser');
    return <DashboardSup />;
  } else if (user_id < 15) {
    console.log('Rendering DashboardAdmin');
    return <DashboardAdmin />;
  } else if (user_id > 15) {
    console.log('Rendering DashboardUser');
    return <DashboardUser />;
  } else {
    console.log('Redirecting to login');
    window.location.href = "/login"; // Redirect to login
    return null; // This line is added to avoid rendering anything when redirecting
  }
}

export default Dashboard;
